const ContactUs = () => {
  return (
    <div className="text-color ms-5 me-5 mr-5 mt-3">
      <header style={{ backgroundColor: '#333', color: '#fff', padding: '20px', textAlign: 'center' }}>
        <h1>Contact Us</h1>
      </header>
      <main style={{ maxWidth: '800px', margin: '0 auto', padding: '20px' }}>
        
       
        <h2>Contact Information</h2>
        <p>Feel free to contact us using the information below:</p>
        <ul>
          <li>Address: Narayan Park, Kala Nagar, Indira Nagar, Nashik, Maharashtra  422009, IN.</li>
          <li>Phone: 9730357805</li>
          <li>Email: spo@example.com</li>
        </ul>
      </main>
    </div>
  );
};

export default ContactUs;
